import React from "react";
import "./App.css";

// Components
import Header from "./components/Header";
import HeroSection from "./components/HeroSection";
import ProjectShowcase from "./components/ProjectShowcase";
import Footer from "./components/Footer";

function App() {
  return (
    <div className="App">
      {/* Header */}
      <Header />

      {/* Hero Section */}
      <HeroSection />

      {/* About Section */}
      <section id="about" className="about-section">
        <div className="container">
          <h2>About Us</h2>
          <p>
            We provide premium office interiors that your employees will love. 
            Our designs focus on functionality, aesthetics, and comfort to 
            create the perfect workspace.
          </p>
        </div>
      </section>

      {/* Portfolio / Projects Section */}
      <section id="portfolio" className="projects">
        <div className="container">
          <h2>Our Projects</h2>
          <ProjectShowcase />
        </div>
      </section>

      {/* Walkthroughs Section */}
      <section id="walkthroughs" className="walkthroughs-section">
        <div className="container">
          <h2>Walkthroughs</h2>
          <p>Take a virtual tour of our premium office interiors.</p>
        </div>
      </section>

      {/* Resources Section */}
      <section id="resources" className="resources-section">
        <div className="container">
          <h2>Resources</h2>
          <p>Access tips, guides, and insights for office interiors.</p>
        </div>
      </section>

      {/* Contact Section */}
      <section id="contact" className="contact-section">
        <div className="container">
          <h2>Contact Us</h2>
          <p>Reach us at +91 7683061117 or via our email.</p>
        </div>
      </section>

      {/* Footer */}
      <Footer />
    </div>
  );
}

export default App;
